string RemoveXMLartifacts(string xmlData)
{
    string result = xmlData;

    string replacement = string.Empty;
    string pattern = @"<\?xml.*\?>";
    result = Regex.Replace(result, pattern, replacement, RegexOptions.IgnoreCase);

    replacement = "";
    pattern = @"[\t\s]+xmlns[^>]+";
    result = Regex.Replace(result, pattern, replacement, RegexOptions.IgnoreCase);

    replacement = "";
    pattern = @"[\t\s]+xsi[^>]+";
    result = Regex.Replace(result, pattern, replacement, RegexOptions.IgnoreCase);

    return result;

